import logo from './logo.svg';
import './App.css';
import { Routes, Route, Link } from "react-router-dom";

import Level1 from './Shared/Categories';
import NotFound from './Shared/Errors/NotFound';
import FormBase from './Shared/FormBase';
import PageBase from './Shared/PageBase';

function App() {
    return (
        <main className="App" id="main" class="sectionOne">
            <div class="container-fluid">
                <div class="row">
                    <div class="col-md-8">

                        <Routes>
                            <Route exact path="/" element={<Level1 />} />

                            <Route path=":form" element={<FormBase page="Description?" />}>
                                <Route path=":page" element={<PageBase />} />
                            </Route>

                            <Route path="*" element={<NotFound />} />
                        </Routes>

                    </div>

                    <div class="col-md-4">

                    </div>
                </div>
            </div>
        </main>
    );
}

export default App;
